const Benefit_Card = ({ benefit, i }) => {
  return (
    <div className="bg-blue-700 size-full flex gap-x-8 px-12 py-5">
      <div className="text-purple-400">
        <i className={benefit.icon + " title-lg"} />
        <div>
          {(i + 1) * <i class="fa-solid fa-circle" />}{" "}
          {(4 - (i + 1)) * <i class="fa-solid fa-circle" />}
        </div>
      </div>
      <div>
        <h3 className="title text-slate-100">{benefit.title}</h3>
        <p className="para text-slate-300">{benefit.describe}</p>
      </div>
    </div>
  );
};

export default Benefit_Card;
